def write_urs_file(pathout):
    # Master regulators. . . .
    line = ">0 Bcr1\n"
    line += "\n"
    line += ">1 Tec1\n"
    line += "\n"  
    line += ">2 Efg1\n"
    line += "\n"
    line += ">3 Ndt80\n"
    line += "\n"
    line += ">4 Brg1\n"
    line += "\n"
    line += ">5 Rob1\n"
    line += "\n"
    
    # Genes upregulated in biofilms. . .
    line += ">6 orf19.6053\n"
    line += "\n"
    line += ">7 orf19.3337\n"
    line += "\n"
    line += ">8 Tpo4\n"
    line += "\n"
    line += ">9 orf19.4000\n"
    line += "\n"
    line += ">10 Eht1\n"
    line += "\n"
    line += ">11 Hwp1\n"
    line += "\n"
    line += ">12 Can2\n"
    line += "\n"
    
    
    # Control genes (not really changed during biofilm state)
    # orf.19.3694
    #line += "13 0 0 \n"
    # orf19.1938
    line += "13 0 0 \n"
    # orf19.3902
    line += "14 0 0 \n"
    line += "15 0 0 AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA\n"
    line += "16 0 0 GGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGGG\n"
    
    fout = open( pathout, "w" )
    fout.write( line )
    fout.close()

def write_pwm_file(pathout):
    fout = open(pathout, "w")
    fout.write("pwm 0 0\n")
    fout.write( get_bcr1() )
    fout.write("pwm 1 0\n")
    fout.write( get_tec1() )
    fout.write("pwm 2 0\n")
    fout.write( get_efg1() )    
    fout.write("pwm 3 0\n")
    fout.write( get_ndt80() )
    fout.write("pwm 4 0\n")
    fout.write( get_brg1() )
    fout.write("pwm 5 0\n")
    fout.write( get_rob1() )
    fout.close()



